package com.zhoukang.y2022;

import java.util.HashMap;
import java.util.Map;

public class Solution {

    public static void main(String[] args){
        String s = "";
        String m = "";
        System.out.println(isAnagram(s, m));
    }

    public static boolean isAnagram(String s, String t) {
        if (s== null || t==null || s.length() != t.length()){
            return false;
        }
        Map<Character, Integer> ms =  parse(s);
        Map<Character, Integer> mt =  parse(t);
        for (Character key: ms.keySet()){
            if (!ms.get(key).equals(mt.remove(key))){
                return false;
            }
        }
        return mt.isEmpty();
    }

    static Map<Character, Integer>  parse(String s){
        Map<Character, Integer> m = new HashMap<Character, Integer>();
        int len = s.length();
        for (int i=0;i<len;i++){
            Character key = s.charAt(i);
            Integer count = m.get(key);
            if (count == null){
                count = 1;
            } else {
                count++;
            }
            m.put(key, count);
        }
        return m;
    }


}
